import ConfirmedOrders from "../components/orders/ConfirmedOrders";

export default function Orders() {
  return (
    <Switch>

      {SEC_NAV_DATA.map((data) => {
         (
          <>
            <Route path={data.path}>{data.component}</Route>
          </>
        );
      })

      }
      {/* <Route path="/orders/neworders">
